import Vue from 'vue'

//引入ElmentUI
import ElementUI from 'element-ui';
import 'element-ui/lib/theme-chalk/index.css';

//引入Bulma
import bulma from 'bulma'
import 'bulma/css/bulma.css'

import App from './App.vue'

Vue.config.productionTip = false
Vue.use(ElementUI)

new Vue({
  render: h => h(App),
}).$mount('#app')
